#!/usr/bin/env ruby

require 'sinatra'
require 'erubis'
require 'active_support'
require 'webrick'
require 'base64'

MYSECRET = 'a7aebc287bba0ee4e64f947415a94e5f'

set :environment, :development
set :bind, '0.0.0.0'
set :port, 8181

# These settings are specific for Sinatra 2.0.0rc2
set :logging, false
set :quiet, true
dev_null = WEBrick::Log::new("/dev/null", 7)
set :server_settings, {:Logger => dev_null, :AccessLog => dev_null}

use Rack::Session::Cookie,
  :key          => "_metasploitable",
  :path         => "/",
  :expire_after => 1800,
  :secret       => MYSECRET

get '/' do
  val = "Shhhhh, don't tell anybody this cookie secret: #{MYSECRET}"
  session['_metasploitable'] = val unless session['_metasploitable']
  body =  "Welcome to Metasploitable3 - Linux edition.<br>"
  body << "<a href='/flag'>If you exploit this application, you will be handsomely rewarded.</a>"
  [200, {}, body]
end

get '/flag' do
  puts session['_metasploitable'].inspect
  if session['_metasploitable'] =~ /(6|six) of clubs/i
    b64 = ''
    data = Base64.strict_decode64(b64)
    return [200, {'Content-Type' => 'image/png'}, data]
  else
    body = "The /flag route can give you a flag if the _metasploitable cookie has the name of the flag.<br>"
    body << "Problem is... cookies are signed. Hmmm..."
  end

  [200, {}, body]
end

